} from 'react-router-dom';

import Temp from './temp';


const Login = () => {

	return (
		<div className="App-intro">
			<Switch>
				<Route exact path="/" component={Home} />
				<Route path="/messages" component={Messages} />
			</Switch>
		</div>
	);
  
}
export default Login;
